import React from 'react';
import img1 from "../assets/img/logo.png";
import { Link } from 'react-router-dom';
import Preloader from './Preloader';


const WelcomePage = () => {
    return (
        <div style={{
            position: 'relative',
            minHeight: '100vh',
            display: 'flex',
            justifyContent: 'center',
            alignItems: 'center',
            padding: '0',
            margin: '0',
            boxSizing: 'border-box',
        }}>
            <Preloader />
            <div style={{
                width: '90vw',
                maxWidth: '800px',
                padding: '20px',
                backgroundColor: 'rgba(255, 255, 255, 0.8)',  // Adjust the background color with transparency
                borderRadius: '10px',
                boxShadow: '0 0 10px rgba(0, 0, 0, 0.1)',
                textAlign: 'center',
            }}>
                <h1 style={{ fontWeight: 'bold', fontSize: '3rem', margin: '0' }}>CARE CUBE</h1> {/* Adjusted font size */}
                <p style={{ fontSize: '1.5rem', margin: '0' }}>Empower yourself to live a happier and stress-free life with our counseling app. Gain valuable insights and guidance for a more fulfilling life journey.</p> {/* Adjusted font size */}
                <div style={{ textAlign: 'center', fontSize: '1.5rem', fontWeight: 'bold', margin: '0', paddingInlineStart: '0' }}> {/* Adjusted font size */}
                    <div>  Personalized Guidance</div>
                    <div>  Stress Relief Techniques</div>
                    <div>  Mindfulness Exercises</div>
                </div>
                <img src={img1} alt="CARE CUBE Image" style={{ maxWidth: '100%', height: 'auto', marginTop: '-25px' }} /> {/* Image below the unordered list */}
                <Link to="/lor">
                    <button class="button-64" role="button" style={{marginTop: '-25px'}}><span class="text">Get Started</span></button>
                </Link>
            </div>
        </div>
    );
}

export default WelcomePage;
